import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import "../../static/style.css";

const Footer = () => (
   <Container>
       <Row>
         <Col className='text-center p'>
         </Col>
         <p>Copyright © 2022 . all rights reserved.</p>
       </Row>
   </Container>
)

export default Footer;
